import React from 'react';
import styled from 'styled-components'

function Instructions() {

    const WrapperInstructions = styled.div`
    height:150px;
    width:700px;
    border:solid;
    border-radius:1rem;
    border-color:white;
    opacity:0.6;
    display:grid;
    grid-template-columns:2fr;
    grid-template-rows
    `

    return (
 
        <WrapperInstructions>
          <h1>Estas son mis funciones</h1>
        </WrapperInstructions>

    )
}

export default Instructions
